  false,\n\t\"url\": null,\n\t\"notes\": \"This part of DS 781 presents data for the
  bathymetry and shaded-relief maps of the Offshore of Fort Ross map area, California.
  Raster data file is included in \"Bathymetry_OffshoreFortRoss.zip,\" which is accessible
  from http://pubs.usgs.gov/ds/781/OffshoreFortRoss/data_catalog_OffshoreFortRoss.html.
  The bathymetry and shaded-relief maps of the Offshore of Fort Ross Map Area, California,
  were generated from bathymetry data collected by California State University, Monterey
  Bay (CSUMB), and by Fugro Pelagos. Mapping was completed between 2007 and 2010,
  using a combination of 200-kHz and 400-kHz Reson 7125, and 244-kHz Reson 8101 multibeam
  echosounders, as well as 468-kHz SEA SWATHPlus interferometric system. These mapping
  missions combined to collect bathymetry from about the 10-m isobath to beyond the
  3-nautical-mile limit of California's State Waters.\",\n\t\"license_title\": null,\n\t\"extras\":
